import VueRouter from "vue-router";

import AboutLearn from '../components/AboutLearn.vue'
import AboutWork from '../components/AboutWork.vue'
import AboutInformation from '../components/AboutInformation.vue'


export default new VueRouter({
    routes:[
        {
            path:'/aboutlearn',
            component:AboutLearn

        },
        {
            path:'/aboutwork',
            component:AboutWork
        },
        {
            path:'/about/information',
            component:AboutInformation

        }
    ]
})
